import React, { Component } from 'react';
import {Button, Dialog, Pane} from 'evergreen-ui';

class MaterialType extends Component {
  constructor(props) {
    super(props);

    this.state = {
      isShown: false,
    }
  }

  render() {
    return (
      <div>
        <Dialog
          isShown={this.state.isShown}
          title="Dialog title"
          onCloseComplete={() => this.setState({isShown:false})}
          confirmLabel="Custom Label">

          Dialog content
        </Dialog>
        <Button onClick={() => this.setState({isShown:true})}> Material Type 2</Button>
      </div>
    );
  }
}

export {MaterialType};
